import axios from "axios";
import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";

function UserDashboard() {
  const [user, setUser] = useState([]);
  const [searchName, setSearchName] = useState("");
  const [searchType, setSearchType] = useState("");
  const [filteredUsers, setFilteredUsers] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:4000/userdetails')
      .then(response => {
        setUser(response.data);
        setFilteredUsers(response.data); // Initialize filteredUsers with all users
      })
      .catch(err => console.log(err));
  }, []);

  // Function to handle search by name
  const handleNameSearch = (e) => {
    setSearchName(e.target.value);
    filterUsers();
  };

  // Function to handle search by type
  const handleTypeSearch = (e) => {
    setSearchType(e.target.value);
    filterUsers();
  };

  // Function to filter users based on search criteria
  const filterUsers = () => {
    let filtered = user.filter((u) => {
      const nameMatch = u.name.toLowerCase().includes(searchName.toLowerCase());
      const typeMatch = u.type.toLowerCase().includes(searchType.toLowerCase());
      return nameMatch && typeMatch;
    });
    setFilteredUsers(filtered);
  };
    return(
      <div>
   
      
      
      <aside class="main-sidebar sidebar-dark-primary elevation-4">
      
        <a href="index3.html" class="brand-link">
       
        <span class="brand-text font-weight-light text-center">Event Sphere</span>
      </a>
      
      
      <div class="sidebar">
      
        <nav class="mt-2">
          <ul class="nav nav-pills nav-sidebar flex-column" data-widget="treeview" role="menu" data-accordion="false">
           
            <li class="nav-item has-treeview menu-open">
              <Link to="/userdashboard" class="nav-link ">
                <i class="nav-icon fas fa-tachometer-alt"></i>
                <p className="text-light">
             My Profile
                <i></i>
                </p>
              </Link>
              </li>
              <li class="nav-item has-treeview menu-open">
              <Link to="/usereventstatus" class="nav-link ">
                <i class="nav-icon fas fa-tachometer-alt"></i>
                <p className="text-light">
             Events
                <i></i>
                </p>
              </Link>
              <Link to="/userticketstatus" class="nav-link ">
                <i class="nav-icon fas fa-tachometer-alt"></i>
                <p className="text-light">
             Tickets Status
                <i></i>
                </p>
              </Link>
           
              </li>
      </ul>
              </nav>
        
      
      
      </div>
      
      </aside>
          {/* Work Start */}
          <div className="content-wrapper">
        <div className="content-header">
          <div className="container-fluid">
            <div className="search-container">
              <input type="text" className="form-control w-25" placeholder="Search by Name" value={searchName} onChange={handleNameSearch} />
              <input type="text" className="form-control w-25" placeholder="Search by Type" value={searchType} onChange={handleTypeSearch} />
              <button className="btn btn-primary ml-2" onClick={handleSearch}>Search</button>
            </div>
            <br />
            <div className="row mb-2">
              <div className="col-lg-12">
                <table className="table table-bordered text-center">
                  <tr>
                    <th>Name</th>
                    <th>Type</th>
                  </tr>
                  {filteredUsers.map((data, index) => (
                    <tr key={index}>
                      <td>{data.name}</td>
                      <td>{data.type}</td>
                    </tr>
                  ))}
                </table>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default UserDashboard;
